import React, { Component } from 'react';
import './effect.css';

class Demande extends Component {
    constructor(props){
        super(props);
        this.state ={
            isLoading : true,
            contacts:[]
        }
    }

    componentDidMount(){
        this.fetchData();
    }

    fetchData(){
        fetch('http://127.0.0.1:8000/api/projet/get/top')
        .then(response => response.json())
        .then(parsedJSON => console.log(parsedJSON.results))
    }



    render() { 
        return ( 
            <div class="grid">
                    <figure class="effect-sadie">
                        <img src="https://source.unsplash.com/random/360x320" alt="img02" />
                        <figcaption>
                            <h2>Holy <span>Sadie</span></h2>
                            <p>Sadie never took her eyes off me. She had a dark soul.</p>
                            <a href="#demande">View more</a>
                        </figcaption>
                    </figure>
            </div>
         );
    }
}
 
export default Demande;
